import { createRouter, createWebHistory } from 'vue-router'
import Componente01 from '../views/Componente01.vue'
import Componente02 from '../views/Componente02.vue'
import Componente03 from '../views/Componente03.vue'

const routes = [
  {
    path: '/',
    name: 'com1',
    component: Componente01
  },

  {
    path: '/',
    name: 'com2',
    component: Componente02
  },

  {
    path: '/',
    name: 'com3',
    component: Componente03
  },

];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
});

export default router;
